import React from 'react';
import { Link } from 'react-router-dom';
import PropTypes from 'prop-types';
import download from '../../../img/download.png';

const CurrentOwnerVehicleItem = ({
  profile: { _id, type, manufacturer, model, transmission, available }
}) => {
  return (
    <div className='profile bg-light'>
      <img src={download} alt='' className='round-img' />
      <div>
        <h2>{type}</h2>
        <p>
          {manufacturer}
          {model && <span>{model}</span>}{' '}
        </p>
        <p>{transmission}</p>
        <Link to={`/VehicleById/${_id}`} className='btn btn-primary'>
          View Vehicle
        </Link>
      </div>
      <ul>
        <li className='text-primary'>
          <i className='fas fa-address-book'></i>{' '}
          {available && <span>{'Availaibility'}</span>}{' '}
        </li>
        <li className='text-primary'>
          <i className='fas fa-check'></i>{' '}
          {available && <span>{available}</span>}{' '}
        </li>
      </ul>
    </div>
  );
};

CurrentOwnerVehicleItem.propTypes = {
  profile: PropTypes.object.isRequired
};

export default CurrentOwnerVehicleItem;
